      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
  ];
  return (
    <div>
      <nav className="NavbarItems">
        <h1 className="NavbarLogo">Nadvbar</h1>
        <div className="MenuIcon"></div>
        <ul>
          <li className={NavItem.className}></li>
        </ul>
      </nav>
    </div>
  );
};

export default Nav;
